import React from "react";
import { locationData } from "./Locations";
export default function LocationData() {
  return (
    <>
      <div className="location-wrap">
        <h1>Popular localities in and around Coimbatore</h1>
        {locationData.map((items) => (
          <p>{items.places}</p>
        ))}
      </div>
    </>
  );
}
